sys_variable_value.value:
(function execute(inputs, outputs) {
  var glideFrom = new GlideDateTime(inputs.From);
  var glideTo = new GlideDateTime(inputs.to);
  var dur = GlideDateTime.subtract(glideFrom, glideTo);

  var hour = dur.getByFormat('HH'); //get hour part
  hour=parseInt(hour,10);
  gs.info("hour::7 "+hour);
  gs.info("typeof hour::"+ typeof(hour));  
  gs.info("hour==4 "+ hour==4);
  if(hour>=3){
    gs.info("line 10::");
    outputs.morethan3 =true;
    gs.info("outputs.moreThan3 : "+outputs.morethan3);
  }
  else
  {outputs.morethan3= false; 
  }
  gs.info("outputs.moreThan3 : "+outputs.morethan3);

})(inputs, outputs);

